import React from "react";
import Card from "./Card";
const List =({title,movies})=>{
    return(
        <div>
            <h1 className="text-xl mb-4 ml-2 text-white font-semibold">{title}</h1>
            <div className="flex">
                movies?.map((movie)=>{
                    <Card/>
                })
                
            </div>
            
        </div>
    )
}
export default List
